import { Component, OnInit, inject } from '@angular/core';
import { Title } from '@angular/platform-browser';
import { CartService } from '../cart.service';
import { Router } from '@angular/router';
import { FormArray, FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Cart } from '../models';
import { LeaveComponent } from '../utils';

@Component({
  selector: 'app-cart',
  templateUrl: './cart.component.html',
  styleUrls: ['./cart.component.css']
})
export class CartComponent implements OnInit, LeaveComponent {

  // Cart  Form
  title = inject(Title)
  cartSvc = inject(CartService)
  router = inject(Router)
  fb = inject(FormBuilder)

form!: FormGroup
itemArr!: FormArray




  ngOnInit(): void {

     this.title.setTitle(`Cart: ${this.cartSvc.username}`)
     this.createForm()

  }


  canExit(): boolean {
    return !this.form.dirty
  }

  getMessage() {
    return "You have not saved your cart.\nAre you sure you want to leave?"
  }


  saveCart() {
    const cart: Cart = this.form.value
    console.info('cart:' , cart)
    this.cartSvc.saveCart(cart)
    .then(result => {
      console.info('saved to db:' , result)

      // clear form
      this.createForm()
      this.router.navigate(['/list'])
    })
    .catch(error => {
      console.error('error:', error)
    })
  }


   addItem() {
    this.itemArr.push(this.createItem())
   }

   removeItem(i: number) {
    this.itemArr.removeAt(i)
   }

  private createForm(): FormGroup {
    return this.fb.group({
      item: this.fb.control('', [Validators.required])

    })
  }

private createItem(): FormGroup {
  return this.fb.group({
    item: this.fb.control('', [Validators.required]),
    quantity: this.fb.control<number>(1, [Validators.required, Validators.min(1)])
  })
}

invalid() {
  return this.form.invalid || this.itemArr.length <= 0
}
}
<h1>Shopping Cart</h1>

<form [formGroup]="form" (submit)="saveCart()">
    <table>
         <tr>
            <td>Title:</td>
            <td>
                <input type="text" size="30" formControlName="title">
            </td>
         </tr>
         <tr>
            <td>Comments:</td>
            <td>
                <textarea cols="30" rows="5" formControlName="comments"></textarea>
            </td>
         </tr>
         <tr>
            <td></td>
            <td>
                <button type="submit" [disabled]="invalid()">Save</button>
                <button type="button" (click)="addItem()">Add item</button>
            </td>
         </tr>
    </table>

    <div *ngIf="itemArr.length > 0; else emptyCart">
        <table>
            <thead>
                <tr>
                    <th>Item</th>
                    <th>Quantity</th>
                </tr>
            </thead>
            <tbody formArrayName="items">
                <tr *ngFor="let it of itemArr.controls; let i = index" [formGroupName]="i">
                    <td>
                        <input type="text" size="30" formControlName="item">
                    </td>
                    <td>
                        <select formGroupName="quantity">
                            <option value="1">1</option>
                            <option value="2">2</option>
                            <option value="3">3</option>
                            <option value="4">4</option>
                            <option value="5">5</option>
                        </select>
                    </td>
                    <td>
                        <button type="button" (click)="removeItem(i)">delete</button>
                    </td>
                </tr>
            </tbody>
        </table>
    </div>

</form>

<button type="button" [routerLink]="['/list']">Cancel</button>
<ng-template #emptyCart>
    <h2>Your cart is empty</h2>
</ng-template>
